import "../css/Main.css"
class NumberMemory extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
          start: false
      };
    }

    componentDidMount(){
      console.log("NumMemory Mounted")
    } 

    timeToClick = () => {

